import Comp from '../components/comp'
import {withRouter} from 'next/router'
import Link from 'next/link'

const A = ({router, name}) => <Link href="#aaa"><a>{router.query.id}{name}</a></Link>

A.getInitialProps = () => {
  return {
    name: 'wn'
  }
}
export default withRouter(A)
